import React, { useState } from 'react';
import {useNavigate} from 'react-router-dom';
import '../CSScomponents/Homepage.css';
import { useLocation } from 'react-router-dom';

export default function NewCostumer(props) {

  const [fullName,setFullName] = useState();
  const [id,setId] = useState();
  const [Address,setAddress] = useState();
  const [phoneNumber,setPhoneNumber] = useState();
  const [plateNumber,setPlateNumber] = useState();

  const onSubmitHandler = (event) =>{
  event.preventDefault();
  }
   
  return (
    <div>
      <form onSubmit={onSubmitHandler}>
        <input type="text" onChange={(e) => {setFullName(e.target.value)}} placeholder="Full name" /><br />
        <input type="text" onChange={(e) => {setId(e.target.value)}} placeholder="ID number" /><br />
        <input type="text" onChange={(e) => {setAddress(e.target.value)}} placeholder="Address" /><br />
        <input type="text" onChange={(e) => {setPhoneNumber(e.target.value)}} placeholder="Phone number" /><br />
        <input type="text" onChange={(e) => {setPlateNumber(e.target.value)}} placeholder="plate number" /><br />
        <button>Register</button>
      </form>
    </div>
  );
}
